import React, { Component } from 'react'
import NewsItem from './NewsItem'

export class News extends Component {
    render() {
        return (
            <div>
                This is news component.
                <NewsItem title="myTitle" description="mydesc"/>
                <NewsItem/>
                <NewsItem/>
                <NewsItem/>
                <NewsItem/>

            </div>
        )
    }
}

export default News
